class Solution(object):
    def countSubarrays(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        def atLeastKTimes(max_num):
            count, ans, j = 0, 0, 0
            for i in range(len(nums)):
                if nums[i] == max_num:
                    count += 1
                while count >= k:
                    if nums[j] == max_num:
                        count -= 1
                    j += 1
                ans += j
            return ans

        max_num = max(nums)
        return atLeastKTimes(max_num)
